window.bookSummaryJSON = "<p>Missy the Werecat, Book 8</p> <p>While busy at West Point, Missy continues helping her government friends deal with terrorists, mob wars and evil witches from overseas. But, with all that going on, maybe she’s picked the wrong time to take over the New England werewolf pack.</p> <p>Of course, whenever anyone takes advantage of women, Missy will always step up. One thing will lead to another. Soon, she’ll need to develop yet another ability to handle everything and deal with all those aligned against her.</p> <p>Fortunately, she also has all those friends helping her. Missy loves playing on a team and with their help, she just might manage to win. Even if that means going to Hong Kong to claim her victory.</p>"; 
